import { useState } from "react";
import { Link } from "react-router-dom";
const ContactList = () => {
    const contacts = [{
        fistName:'Ruchika',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Snahal',
        lastName:'Falake',
        contactNumber:'+1234567872'
    },{
        fistName:'Poonam',
        lastName:'Bharati',
        contactNumber:'+324123432'
    },{
        fistName:'Varsha',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Manisha',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Akshay',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Yogesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Mahesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Sandesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Dinesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    }]
    const [contactList,setContactList] = useState(contacts)
 return(<>
 <div className="row">
    <div className="col-5 col-sm-5 col-md-5 col-lg-5 col-xl-5" id="contacts">
    <table className="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Name</th>

    </tr>
  </thead>
  <tbody>
    {contactList.map((contact,index)=>{
         return (<tr>
            <th scope="row">{index+1}</th>
            <td>
                <Link>{contact.fistName}</Link>
            </td>

          </tr>)
    })}
  </tbody>
  </table>
    </div>
 </div>

 </>)
}
export default ContactList;
